import Link from 'next/link';
const Singleproduct = (propl) =>{
    const { products } = propl;
    return(
        <div class="row">
            <div class="col-lg-6">
                <div class="product-pic-zo">
                    <img class="product-big-img" src={products.image.sourceUrl} alt=""/>
                </div>
            </div>
        </div>        
    );
}
export default Singleproduct;
